Sentencing proceeded.  Statements by the State, defense and defendant.   
The Court ordered defendant to serve 45 days in the House of Correction, concurrent to any other sentence, with credit for 3 days time served, The Court granted Huber privileges, pursuant to 303.08 Wis. Stats. for work and work group.

Court ordered defendant to pay fine of $25.00 plus all applicable court costs and fees, including DNA surcharge by 03-17-2016, or to be docketed as a civil judgment/tax intercept.

